const EVENTS = [
    {id : "event-1" , title : "Event 1", image : "Image 1", date : "11-12-2024"},
    {id : "event-2" , title : "Event 2", image : "Image 2", date : "11-12-2024"},
    {id : "event-3" , title : "Event 3", image : "Image 3", date : "11-12-2024"},
    {id : "event-4" , title : "Event 4", image : "Image 4", date : "11-12-2024"}
]

function EventsPage() {
    return <>
    <h1>Events Page</h1>
    <ul>
    {EVENTS.map((event) => {
        <li key={event.id}><Link to={`events/${event.id}`}>{event.title}</Link></li>
    })}
    </ul>
    </>;
}

export default EventsPage;
